import React from 'react';
import Typewriter from 'typewriter-effect';
import { node } from 'prop-types';



const Header = () => {
  const bemVindo = `Bem Vindo!`;
  const welcome = `You're Welcome!`;

  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter
          .typeString(bemVindo.props.children)
          .pauseFor(2000)
          .deleteAll()
          .typeString(welcome.props.children)
          .start();
        }} />
    </div>
  );
}

Header.propTypes = {
  children: node.isRequired,
  bemVindo: node.isRequired,
  welcome: node.isRequired,
}

export default Header;
